import React from 'react';
import { Container, Menu, Icon, Image } from 'semantic-ui-react';

const Header = () => {
  return (
    <Menu stackable fluid id="menu" inverted>
      <Container text>
        <Menu.Item header>
          <Image size="mini" src="/static/logo.svg" style={{ marginRight: '1em' }} />
          LOGO
        </Menu.Item>

        <Menu.Item header>
          <Icon name="home" size="large" />
          DEFAULT PAGE
        </Menu.Item>
        <Menu.Item header>
          <Icon name="cart" size="large" />
          THANK YOU PAGE
        </Menu.Item>
      </Container>
    </Menu>
  );
};

export default Header;
